import ReactDOM from 'react-dom';
import { DesignTipIf } from '../component/designTipIf';
export function ReviewDesignTip(){
    // document.querySelector("body").style.overflow= "hidden";
    document.getElementById("designTips-if").classList.add("dt-show");
    ReactDOM.render(<DesignTipIf />, document.getElementById("designTips-if"));
}
export function CloseDesignTip(){
    document.querySelector("body").style.overflow= "auto";
    document.getElementById("designTips-if").classList.remove("dt-show");
    ReactDOM.render(null, document.getElementById("designTips-if"));
}
